import React from 'react';
import { Segment, Grid, Icon, Table } from 'semantic-ui-react';
import {format} from 'date-fns';
import { IAffilie } from '../../../app/models/affilie';

const AffilieDetailedInfo: React.FC<{affilie: IAffilie}> = ({affilie}) => {
  return (

    <Table celled>
    <Table.Header>
      <Table.Row>
        <Table.HeaderCell>N Dossier</Table.HeaderCell>
        <Table.HeaderCell>Date Paiement</Table.HeaderCell>
        <Table.HeaderCell>Fr Engage</Table.HeaderCell>
        <Table.HeaderCell>AMO</Table.HeaderCell>
        <Table.HeaderCell>MPSC</Table.HeaderCell>
        <Table.HeaderCell>TOTAL</Table.HeaderCell>
        <Table.HeaderCell>T.Dossier</Table.HeaderCell>
      </Table.Row>
    </Table.Header>

    <Table.Body>
      <Table.Row>

        {affilie.Qps.forEach(qp => {
            <Table.Cell>{qp.nDossier}</Table.Cell>
        })};


      </Table.Row>
    </Table.Body>
  </Table>

  );
};

export default AffilieDetailedInfo;
